import Services from './components/Services';
import Form from './components/Form';
import Navbar from './components/Navbar';
import './components/styles/Navbar.css'
function App() {
  return (
    <Router>
    <div className='App'>
     <Form />
     <Navbar />

    </div>
    </Router>
  );
}

export default App;
